	(1288, 288, '_form', '<div class="container mt-40">\n  <div class="row">\n    <div class="columns full cf7sg-slider-section" data-next="Next" data-prev="Previous" data-submit="Submit" data-dots="true">\n      <div class="container cf7sg-collapsible" id="shJhGz">\n        <div class="cf7sg-collapsible-title"><span class="cf7sg-title">Personal Information</span></div>\n        <div class="row">\n          <div class="columns full">\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Full Name<em>*</em></label>[text* user-name]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Nickname</label>[text user-nickname]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-third">\n                  <div class="field"><label>Birthdate<em>*</em></label>[date* user-birthdate]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-third">\n                  <div class="field"><label>Age<em>*</em></label>[number* user-age min:0 max:100]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-third">\n                  <div class="field"><label>Gender</label>[radio user-gender label_first use_label_element default:1 "Male" "Female"]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Birthplace<em>*</em></label>[text* user-birthplace]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Nationality<em>*</em></label>[text* user-nationality]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns full">\n                  <div class="field"><label>Languages<em>*</em></label>[text* user-languages placeholder "Input a comma between languages"]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Phone Number<em>*</em></label>[tel* user-phone]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Email<em>*</em></label>[email* user-email]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Instagram</label>[text user-instagram]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Address</label>[text user-address]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n      <div class="container cf7sg-collapsible" id="NJ89bs">\n        <div class="cf7sg-collapsible-title"><span class="cf7sg-title">Measurements</span></div>\n        <div class="row">\n          <div class="columns full">\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Height<em>*</em></label>[text* user-height]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Bust/Chest<em>*</em></label>[text* user-chest]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Bra Cup<em>*</em></label>[text* user-cup]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Waist<em>*</em></label>[text* user-waist]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Hips<em>*</em></label>[text* user-hips]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Eyes Color<em>*</em></label>[text* user-eyes]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Hair Color<em>*</em></label>[text* user-hair-color]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Hair Length<em>*</em></label>[select* user-hair-length "Short" "Medium" "Long"]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Hair Type<em>*</em></label>[select* user-hair-type "Curly" "Straight" "Wavy"]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Shoes Size (EU)<em>*</em></label>[text* user-shoes-size]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Dress Size<em>*</em></label>[select* user-dress-size "S" "M" "L"]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Vest<em>*</em></label>[text* user-vest]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n            <div class="container">\n              <div class="row">\n                <div class="columns one-half">\n                  <div class="field"><label>Pant Size<em>*</em></label>[text* user-pants-size]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n                <div class="columns one-half">\n                  <div class="field"><label>Ethnicity<em>*</em></label>[text* user-ethnicity]\n                    <p class="info-tip"></p>\n                  </div>\n                </div>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n      <div class="container cf7sg-collapsible" id="aZinka">\n        <div class="cf7sg-collapsible-title"><span class="cf7sg-title">Disclaimer</span></div>\n        <div class="row">\n          <div class="columns full">\n            <div class="field"><label>I hereby declare that I authorize DO Model Management to engage business for my modeling career. DO Model Management is hereby granted the right to use and distrivute and allow or license other to make use of and distribute Model\'s name, portrait and pictures in connection with the website, publicity, and advertisement. Model agrees to DO Model Management with the given information, photographs, material for advertising use of DO Model Management. I have read and understood with the terms and conditions states above. I give consent to the confidentiality use of my contact information by DO Model Management.<em>*</em></label> <br>\n              <p style="color:#ef5454;margin-bottom:10px">The submit button will only be available if only you have completed all the required inputs and tick the \'I Agree\' checkbox. Kindly check all your inputs.</p>[checkbox* user-disclaimer id:user-disclaimer use_label_element exclusive "I Agree"]\n              <p class="info-tip"></p>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>'),
