	(9, 1, '2021-03-25 17:35:46', '2021-03-25 17:35:46', '<p>With our <a href="https://cocainemodels.com/agency/">modeling agency</a> you will find the perfect model for your next advertising campaign. We will help you with the search as <a href="https://cocainemodels.com/agency/casting/">casting agency</a> as well as with the quick selection of models. Fashion, advertising, casting, fair &amp; <a href="https://cocainemodels.com/fashion-magazine/">magazines</a>. CM guarantees your shootings / productions quality at a high level – day after day. With CM, the Model Management, you always get your model selection fast, carefree and uncomplicated. Write us your wishes at any time.</p>\n<p>We represent models in the USA with office in <a href="https://cocainemodels.com/los-angeles/">Los Angeles</a> and in Germany, <a href="https://cocainemodels.com/berlin/">Berlin</a>, <a href="https://cocainemodels.com/hamburg/">Hamburg</a> and models in other cities! For national and international campaigns. Did you know? CM also helps you to connect with reliable partners from <a href="https://cocainemodels.com/milan/">Mailand</a>, <a href="https://cocainemodels.com/paris/">Paris</a>, <a href="https://cocainemodels.com/new-york/">New York</a> and <a href="https://cocainemodels.com/london/">London</a>. With partner agencies, <a href="https://photoagencyone.com/" target="_blank" rel="noopener noreferrer">photographers</a> and local scouts we accompany young models as managers into their careers. Thus we are as modeling agency an absolutely reliable partner also for campaigns of advertising agencies, companies and marks. We give you a fast and uncomplicated individual, tailor-made selection for your project!</p>\n<p>Cocaine Models has been one of the top agencies in Germany since the beginning of ’15! Among others, the BRAVO GIRL! has already voted us in the second year to the 10 top agencies in Germany, of course also in the following year – a real honor. We help New Faces to become a model! With experts, coachings, shootings and time!</p>\n<p>We organize expressive talents for <a href="https://cocainemodels.com/commercial-model-agency/">commercials</a>, campaigns, castings, stores, <a href="https://cocainemodels.de/model-werden/showroom/" target="_blank" rel="noopener">showrooms</a> and shops. We attach great importance to ambition and punctuality. Thus we reach together with you high quality, representative results which convince your customers. With <a href="https://cocainemodels.com/spring-summer-video-catwalk-coaching-casting-jobs-tvcs/">Coachings</a>, individual discussions and trainings we get the best out of our talents. We are where you are – no way is too far for us. CM is at your side in Selection &amp; Casting. We organize smooth processes for you and your customers, in front of and behind the scenes. For you as a customer, we offer even more interesting additional services: Social Media, Influencer, Castings and switching at top photographers and <a href="https://cocainemodels.com/basic-knowledge-models-backstage-youtube-video-shooting/">videographers</a> in Germany and Europe. Our job is the perfect occupation. In the <a href="https://cocainemodels.com/blog/">Model &amp; Fashion Blog</a> there are new shootings, photos and castings. Do Model Management Prevails.</p>', 'This is Do Model Management', '', 'inherit', 'closed', 'closed', '', '1-autosave-v1', '', '', '2021-03-25 17:35:46', '2021-03-25 17:35:46', '', 1, 'http://domodelmanagement.test/?p=9', 0, 'revision', '', 0),
