	(21, 1, '2021-03-25 17:42:05', '2021-03-25 17:42:05', 'CM – Who are we? Our model agency arranges first-class models for advertising and fashion all over Germany and worldwide. Since the beginning of ’15 we have been present in all major cities with models in Germany: <a href="https://cocainemodels.com/berlin">Berlin</a> an <a href="https://cocainemodels.com/hamburg">Hamburg</a>. Need support for international bookings? We guide you and help with selected partners in cities like <a href="https://cocainemodels.com/london">London</a>, <a href="https://cocainemodels.com/paris">Paris</a>, <a href="https://cocainemodels.com/milan">Milan</a> and <a href="https://cocainemodels.com/new-york/">New York</a>. As model agency we concern ourselves not only with the customer business, but also with the to <a href="https://cocainemodels.com/become-a-model">become a model </a>. With the targeted development of young talents. Because model scouting is about finding the best talents and, like sport, it is about targeted promotion of young talent. As model agents, we make every effort to prepare our talents (models and influencers) perfectly and promote them in a targeted manner. Only with first-class management can models achieve the maximum results for our customers in advertising film shoots and photo shoots – win win for models &amp; customers.\r\n\r\nA model only has a few hours on the set to deliver perfect performance. Whether it’s the <a href="https://cocainemodels.com/fashion-show-agency/">fashion show</a> or <a href="https://cocainemodels.com/advertising-photography-experts-for-fashion-technology-and-campaigns/">advertisment photography</a>. The special talent of a top model is to function extremely accurately during this period. We find the best talents in Germany and Europe, for you! We take care of travel planning and management as well as the guarantee to have the best of the best on set.', 'International Models', '', 'publish', 'open', 'open', '', 'international-models', '', '', '2021-03-25 17:47:04', '2021-03-25 17:47:04', '', 0, 'http://domodelmanagement.test/?p=21', 0, 'post', '', 0),
