	(29, 1, '2021-03-25 17:49:38', '2021-03-25 17:49:38', 'Once a <a href="https://cocainemodels.com/women/new/">model new face</a> has been set up, it goes to the equally targeted mediation. Here we look in particular for our customers and clients, which model fits to which job. For customers we search as <a href="https://cocainemodels.com/agency/casting/">casting agency</a> therefore in the apron, from the different Portfolios, the suitable candidates and present them in a short and clear form, digitally or in the personal Meeting. Thereupon our customers can decide for their favourite model. No matter which production or fashion show it is, we will find your model!\r\n\r\nThe mediation of models includes more than just the administration. Here it concerns constant pictorial material update, high-quality <a href="https://cocainemodels.de/model-werden/testshootings/" target="_blank" rel="noopener">Testshootings</a> with photographers or also internal production by our model agency. Thus our models and customers always have top current material. So what matters is that the material is always up to date, that the character is optimally represented by the selection of images and videos, but also that we suggest for jobs. Because castings and offers get many models to find out the real diamonds, that is the challenge. Just like always, the construction of models.', 'Gallery of Models', '', 'trash', 'open', 'open', '', 'gallery-of-models__trashed', '', '', '2021-04-10 17:50:38', '2021-04-10 17:50:38', '', 0, 'http://domodelmanagement.test/?p=29', 0, 'post', '', 0),
