	(33, 1, '2021-03-25 17:50:28', '2021-03-25 17:50:28', '<a href="https://cocainemodels.com/become-a-model/">Become a model</a>, that’s what many people want! No matter if you are 14, 15 or 16 years old, the earlier you start modeling, the better. But as a rule you should not be younger than 15 years, because before that it is all about basic education, school and learning, learning, learning. Until the end of school you have time to build yourself up. You can gradually gain valuable experience during the first small test shoots but also during the first jobs. Of course, many of them start at the age of 18, 19 or 21. We as model agency and <a href="https://cocainemodels.com/modeling-agencies-from-the-mother-agency-to-the-model-agent-and-boutique-agency/">mother agency</a> help you to go a direct and promising way – directly and without detours. With our experience and expertise we bring models already with young years to extremely good photographers, in order to get for you exclusive and good material. The more extensive your <a href="https://cocainemodels.com/the-perfect-model-folder-for-your-next-casting/">model book</a> is, the easier it is for customers to see you as a model in the campaign.', 'Working Arrangement', '', 'publish', 'open', 'open', '', 'working-arrangement', '', '', '2021-03-27 12:20:24', '2021-03-27 12:20:24', '', 0, 'http://domodelmanagement.test/?p=33', 0, 'post', '', 0),
	(34, 1, '2021-03-25 17:50:28', '2021-03-25 17:50:28', '<a href="https://cocainemodels.com/become-a-model/">Become a model</a>, that’s what many people want! No matter if you are 14, 15 or 16 years old, the earlier you start modeling, the better. But as a rule you should not be younger than 15 years, because before that it is all about basic education, school and learning, learning, learning. Until the end of school you have time to build yourself up. You can gradually gain valuable experience during the first small test shoots but also during the first jobs. Of course, many of them start at the age of 18, 19 or 21. We as model agency and <a href="https://cocainemodels.com/modeling-agencies-from-the-mother-agency-to-the-model-agent-and-boutique-agency/">mother agency</a> help you to go a direct and promising way – directly and without detours. With our experience and expertise we bring models already with young years to extremely good photographers, in order to get for you exclusive and good material. The more extensive your <a href="https://cocainemodels.com/the-perfect-model-folder-for-your-next-casting/">model book</a> is, the easier it is for customers to see you as a model in the campaign.', 'Working Arrangement', '', 'inherit', 'closed', 'closed', '', '33-revision-v1', '', '', '2021-03-25 17:50:28', '2021-03-25 17:50:28', '', 33, 'http://domodelmanagement.test/?p=34', 0, 'revision', '', 0),
	(35, 1, '2021-03-25 17:51:05', '2021-03-25 17:51:05', 'As a model agency we are naturally at the plus of time and through our customers we are also often in contact with <a href="https://cocainemodels.com/media-agency-advertising-shooting-and-social-media-marketing/">media production,</a> advising like an advertising agency. No matter if it is about social media content, e.g. <a href="https://cocainemodels.com/youtube-marketing-agency-concept-strategy-and-video-production/">YouTube videos</a> or Instagram photo shootings or also the cooperation with <a href="https://cocainemodels.com/influencer/">influencers for advertising campaigns</a>. Therefore we help our customers with inquiries also gladly in the topic media production and marketing further. We will put you in touch with experts for challenging projects. As Creative Art Director Oliver Rudolph is the head of our creative division. He not only makes sure that the perfect models are on our board as chief scout but also that photo shoots always achieve the excellence they are supposed to achieve. In addition, we produce more and more film material about the shootings, his small backstage video for the launch of the campaign, short Instagram videos or YouTube videos. So at the end of the photo shoot you have more than “just” the photo campaigns.', 'Couple Models', '', 'trash', 'open', 'open', '', 'doing-lively-video__trashed', '', '', '2021-04-10 17:50:24', '2021-04-10 17:50:24', '', 0, 'http://domodelmanagement.test/?p=35', 0, 'post', '', 0),
	(36, 1, '2021-03-25 17:51:05', '2021-03-25 17:51:05', 'As a model agency we are naturally at the plus of time and through our customers we are also often in contact with <a href="https://cocainemodels.com/media-agency-advertising-shooting-and-social-media-marketing/">media production,</a> advising like an advertising agency. No matter if it is about social media content, e.g. <a href="https://cocainemodels.com/youtube-marketing-agency-concept-strategy-and-video-production/">YouTube videos</a> or Instagram photo shootings or also the cooperation with <a href="https://cocainemodels.com/influencer/">influencers for advertising campaigns</a>. Therefore we help our customers with inquiries also gladly in the topic media production and marketing further. We will put you in touch with experts for challenging projects. As Creative Art Director Oliver Rudolph is the head of our creative division. He not only makes sure that the perfect models are on our board as chief scout but also that photo shoots always achieve the excellence they are supposed to achieve. In addition, we produce more and more film material about the shootings, his small backstage video for the launch of the campaign, short Instagram videos or YouTube videos. So at the end of the photo shoot you have more than “just” the photo campaigns.', 'Doing Lively Video', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2021-03-25 17:51:05', '2021-03-25 17:51:05', '', 35, 'http://domodelmanagement.test/?p=36', 0, 'revision', '', 0),
