	(41, 1, '2021-03-25 17:54:45', '2021-03-25 17:54:45', '', 'Archive', '', 'inherit', 'closed', 'closed', '', '40-revision-v1', '', '', '2021-03-25 17:54:45', '2021-03-25 17:54:45', '', 40, 'http://domodelmanagement.test/?p=41', 0, 'revision', '', 0),
	(42, 1, '2021-03-25 17:56:22', '2021-03-25 17:56:22', 'https://www.youtube.com/watch?v=t4UptoAoSeM&amp;t=2s\r\n\r\n&nbsp;\r\n\r\nvideo-url\r\n\r\n&nbsp;\r\n\r\nWhat are influencers? Influencers reach extremely many people. This target group is very interesting for many brands, because it is organic and very accurately identifiable. The targeted “application” is called <a href="https://cocainemodels.com/influencer/">influencer marketing</a>. As Influencer one calls the marks in its videos or in its photos, one builds them into the picture or video material also. Thus the mark is present with the own target group. The more frequently one accomplishes this action, the more the thought sets itself to the mark name and/or the name even in the head. As in classical advertising, the more often something is mentioned, the better known it becomes. Many models are influencers, by nature! Therefore our agency mediates as one of the first Blogger for campaigns and Events. We have expertise in different areas, whether single bookings of influencers for Instagram or more complex constructs, larger campaigns or events and the booking of up to 20 or 30 influencers. They are so popular because their target group is extremely close to that of fashion brands, all lifestyle and luxury products.', 'Greeny Models', '', 'trash', 'open', 'open', '', 'greeny-models__trashed', '', '', '2021-04-10 17:50:27', '2021-04-10 17:50:27', '', 0, 'http://domodelmanagement.test/?p=42', 0, 'post', '', 0),
