	(55, 1, '2021-03-25 18:17:59', '2021-03-25 18:17:59', 'Virtual / Digital Influencers – Cocaine Models is the first model agency in Europe with virtual influencers. Exclusive and new! For many, virtual or digital influencers are something completely new. Especially for marketing strategies. International examples like Lil Miquela show that it makes little difference to people if the star on Instagram is “real”. What', 'Virtual Influencer / Models / Avatar: Social Media Marketing Strategy – Trends', '', 'trash', 'open', 'open', '', 'virtual-influencer-models-avatar-social-media-marketing-strategy-trends__trashed', '', '', '2021-04-10 17:51:02', '2021-04-10 17:51:02', '', 0, 'http://domodelmanagement.test/?p=55', 0, 'post', '', 0),
	(56, 1, '2021-03-25 18:17:59', '2021-03-25 18:17:59', 'Virtual / Digital Influencers – Cocaine Models is the first model agency in Europe with virtual influencers. Exclusive and new! For many, virtual or digital influencers are something completely new. Especially for marketing strategies. International examples like Lil Miquela show that it makes little difference to people if the star on Instagram is “real”. What', 'Virtual Influencer / Models / Avatar: Social Media Marketing Strategy – Trends', '', 'inherit', 'closed', 'closed', '', '55-revision-v1', '', '', '2021-03-25 18:17:59', '2021-03-25 18:17:59', '', 55, 'http://domodelmanagement.test/?p=56', 0, 'revision', '', 0),
	(57, 1, '2021-03-25 18:19:31', '2021-03-25 18:19:31', 'With our modeling agency you will find the perfect model for your next advertising campaign. We will help you with the search as casting agency as well as with the quick selection of models. Fashion, advertising, casting, fair & magazines. CM guarantees your shootings / productions quality at a high level – day after day. With CM, the Model Management, you always get your model selection fast, carefree and uncomplicated. Write us your wishes at any time.\r\n\r\nWe represent models in the USA with office in Los Angeles and in Germany, Berlin, Hamburg and models in other cities! For national and international campaigns. Did you know? CM also helps you to connect with reliable partners from Mailand, Paris, New York and London. With partner agencies, photographers and local scouts we accompany young models as managers into their careers. Thus we are as modeling agency an absolutely reliable partner also for campaigns of advertising agencies, companies and marks. We give you a fast and uncomplicated individual, tailor-made selection for your project!', 'Buffalo: “Bolder than Ever” campaign & video with Ella (VR)', '', 'trash', 'open', 'open', '', 'buffalo-bolder-than-ever-campaign-video-with-ella-vr__trashed', '', '', '2021-04-10 17:50:14', '2021-04-10 17:50:14', '', 0, 'http://domodelmanagement.test/?p=57', 0, 'post', '', 0),
