	(60, 1, '2021-03-25 18:20:13', '2021-03-25 18:20:13', 'As a model agency we are naturally at the plus of time and through our customers we are also often in contact with <a href="https://cocainemodels.com/media-agency-advertising-shooting-and-social-media-marketing/">media production,</a> advising like an advertising agency. No matter if it is about social media content, e.g. <a href="https://cocainemodels.com/youtube-marketing-agency-concept-strategy-and-video-production/">YouTube videos</a> or Instagram photo shootings or also the cooperation with <a href="https://cocainemodels.com/influencer/">influencers for advertising campaigns</a>. Therefore we help our customers with inquiries also gladly in the topic media production and marketing further. We will put you in touch with experts for challenging projects. As Creative Art Director Oliver Rudolph is the head of our creative division. He not only makes sure that the perfect models are on our board as chief scout but also that photo shoots always achieve the excellence they are supposed to achieve. In addition, we produce more and more film material about the shootings, his small backstage video for the launch of the campaign, short Instagram videos or YouTube videos. So at the end of the photo shoot you have more than “just” the photo campaigns.', 'Doing Lively Video', '', 'inherit', 'closed', 'closed', '', '35-autosave-v1', '', '', '2021-03-25 18:20:13', '2021-03-25 18:20:13', '', 35, 'http://domodelmanagement.test/?p=60', 0, 'revision', '', 0),
