	(67, 1, '2021-03-25 18:58:24', '2021-03-25 18:58:24', '', 'pexels-lamont-thompson-3271024', '', 'inherit', 'open', 'closed', '', 'pexels-lamont-thompson-3271024', '', '', '2021-03-25 18:58:24', '2021-03-25 18:58:24', '', 35, 'http://domodelmanagement.test/wp-content/uploads/2021/03/pexels-lamont-thompson-3271024.jpg', 0, 'attachment', 'image/jpeg', 0),
	(68, 1, '2021-03-25 19:00:50', '2021-03-25 19:00:50', 'We need your personal data, measurements &amp; sizes and Polaroids. Your photos should not be older than 3 months and should show among other things your current appearance, hairstyle and hair length. Unfortunately it is not possible for us to answer all of them due to the large number of applications. Therefore we ask for your understanding. If it fits, our scout will contact you within 14 days after your application! Read here more about requirements and really everything, find in the XXL Model Guide: <a href="https://cocainemodels.com/become-a-model">Become a model</a>.', 'Models on internship for a year in Paris', '', 'publish', 'open', 'open', '', 'models-on-internship-for-a-year-in-paris', '', '', '2021-04-09 17:16:24', '2021-04-09 17:16:24', '', 0, 'http://domodelmanagement.test/?p=68', 0, 'post', '', 0),
	(69, 1, '2021-03-25 19:00:50', '2021-03-25 19:00:50', 'We need your personal data, measurements &amp; sizes and Polaroids. Your photos should not be older than 3 months and should show among other things your current appearance, hairstyle and hair length. Unfortunately it is not possible for us to answer all of them due to the large number of applications. Therefore we ask for your understanding. If it fits, our scout will contact you within 14 days after your application! Read here more about requirements and really everything, find in the XXL Model Guide: <a href="https://cocainemodels.com/become-a-model">Become a model</a>.', 'Models on internship for a year in Paris', '', 'inherit', 'closed', 'closed', '', '68-revision-v1', '', '', '2021-03-25 19:00:50', '2021-03-25 19:00:50', '', 68, 'http://domodelmanagement.test/?p=69', 0, 'revision', '', 0),
	(70, 1, '2021-03-26 04:06:15', '2021-03-26 04:06:15', 'https://www.youtube.com/watch?v=t4UptoAoSeM\r\n\r\n&lt;!--more--&gt;\r\n\r\nWhat are influencers? Influencers reach extremely many people. This target group is very interesting for many brands, because it is organic and very accurately identifiable. The targeted “application” is called <a href="https://cocainemodels.com/influencer/">influencer marketing</a>. As Influencer one calls the marks in its videos or in its photos, one builds them into the picture or video material also. Thus the mark is present with the own target group. The more frequently one accomplishes this action, the more the thought sets itself to the mark name and/or the name even in the head. As in classical advertising, the more often something is mentioned, the better known it becomes. Many models are influencers, by nature! Therefore our agency mediates as one of the first Blogger for campaigns and Events. We have expertise in different areas, whether single bookings of influencers for Instagram or more complex constructs, larger campaigns or events and the booking of up to 20 or 30 influencers. They are so popular because their target group is extremely close to that of fashion brands, all lifestyle and luxury products.', 'Greeny Models', '', 'inherit', 'closed', 'closed', '', '42-revision-v1', '', '', '2021-03-26 04:06:15', '2021-03-26 04:06:15', '', 42, 'http://domodelmanagement.test/?p=70', 0, 'revision', '', 0),
