	(126, 1, '2021-03-27 12:03:06', '2021-03-27 12:03:06', 'With our modeling agency you will find the perfect model for your next advertising campaign. We will help you with the search as casting agency as well as with the quick selection of models. Fashion, advertising, casting, fair & magazines. CM guarantees your shootings / productions quality at a high level – day after day. With CM, the Model Management, you always get your model selection fast, carefree and uncomplicated. Write us your wishes at any time.\r\n\r\nWe represent models in the USA with office in Los Angeles and in Germany, Berlin, Hamburg and models in other cities! For national and international campaigns. Did you know? CM also helps you to connect with reliable partners from Mailand, Paris, New York and London. With partner agencies, photographers and local scouts we accompany young models as managers into their careers. Thus we are as modeling agency an absolutely reliable partner also for campaigns of advertising agencies, companies and marks. We give you a fast and uncomplicated individual, tailor-made selection for your project!', 'Buffalo: “Bolder than Ever” campaign & video with Ella (VR)', '', 'inherit', 'closed', 'closed', '', '57-revision-v1', '', '', '2021-03-27 12:03:06', '2021-03-27 12:03:06', '', 57, 'http://domodelmanagement.test/?p=126', 0, 'revision', '', 0),
