	(165, 1, '2021-04-01 08:18:28', '2021-04-01 08:18:28', '{\n    "jetpack_portfolio_title": {\n        "value": "Artists",\n        "type": "option",\n        "user_id": 1,\n        "date_modified_gmt": "2021-04-01 08:18:02"\n    },\n    "jetpack_portfolio_content": {\n        "value": "An artist is a person engaged in an activity related to creating art, practicing the arts, or demonstrating an art. The common usage in both everyday speech and academic discourse refers to a practitioner in the visual arts only. However, the term is also often used in the entertainment business, especially in a business context, for musicians and other performers (although less often for actors)",\n        "type": "option",\n        "user_id": 1,\n        "date_modified_gmt": "2021-04-01 08:18:28"\n    },\n    "jetpack_portfolio_featured_image": {\n        "value": "http://domodelmanagement.test/wp-content/uploads/2021/03/pexels-inga-seliverstova-3550261.jpg",\n        "type": "option",\n        "user_id": 1,\n        "date_modified_gmt": "2021-04-01 08:18:02"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', 'bffdff3d-417e-498a-a95f-6aa644c9a5a2', '', '', '2021-04-01 08:18:28', '2021-04-01 08:18:28', '', 0, 'http://domodelmanagement.test/?p=165', 0, 'customize_changeset', '', 0),
