	(198, 1, '2021-04-04 06:13:42', '2021-04-04 06:13:42', 'With our <a href="https://cocainemodels.com/agency/">modeling agency</a> you will find the perfect model for your next advertising campaign. We will help you with the search as <a href="https://cocainemodels.com/agency/casting/">casting agency</a> as well as with the quick selection of models. Fashion, advertising, casting, fair &amp; <a href="https://cocainemodels.com/fashion-magazine/">magazines</a>. CM guarantees your shootings / productions quality at a high level – day after day. With CM, the Model Management, you always get your model selection fast, carefree and uncomplicated. Write us your wishes at any time.\r\n\r\n<a class="button" href="#">Read More</a>', 'We\'ll find the suitable model for you', '', 'inherit', 'closed', 'closed', '', '109-revision-v1', '', '', '2021-04-04 06:13:42', '2021-04-04 06:13:42', '', 109, 'http://domodelmanagement.test/?p=198', 0, 'revision', '', 0),
