	(232, 1, '2021-04-04 07:11:40', '2021-04-04 07:11:40', 'DO Model Management is a modeling and talent agency established in the Middle East. Making a name for itself, this agency redefines beauty and discovers potential talents in fields of Fashion, Media, and Entertainment.		\n			<h2>Vision-Mission</h2>		\n		DO Model Management’s vision  is to be recognized as one of the top Modelling and Talent Agencies in the world. This agency aims to shape and represent models &amp; talents who are building their career in the industry. DO Model Management is grounded with values of Passion, Accountability, Teamwork, and Trust.', 'About Us', '', 'inherit', 'closed', 'closed', '', '171-revision-v1', '', '', '2021-04-04 07:11:40', '2021-04-04 07:11:40', '', 171, 'http://domodelmanagement.test/?p=232', 0, 'revision', '', 0),
