	(344, 1, '2021-04-09 17:08:04', '2021-04-09 17:08:04', 'We organize expressive talents for commercials, campaigns, castings, stores, showrooms and shops. We attach great importance to ambition and punctuality. Thus we reach together with you high quality, representative results which convince your customers. With Coachings, individual discussions and trainings we get the best out of our talents. We are where you are – no way is too far for us. CM is at your side in Selection &amp; Casting. We organize smooth processes for you and your customers, in front of and behind the scenes. For you as a customer, we offer even more interesting additional services: Social Media, Influencer, Castings and switching at top photographers and videographers in Germany and Europe. Our job is the perfect occupation. In the Model &amp; Fashion Blog there are new shootings, photos and castings.', 'Finding your dream in the city', '', 'inherit', 'closed', 'closed', '', '143-revision-v1', '', '', '2021-04-09 17:08:04', '2021-04-09 17:08:04', '', 143, 'http://domodelmanagement.test/?p=344', 0, 'revision', '', 0),
